import React from 'react';
import Paper from '@material-ui/core/Paper';







const Ad = (props) => {
    return(
        <Paper style={{padding: '30px', textAlign: 'center'}}>
              <h5>Ad</h5>
        </Paper>
    );
};

export default Ad;
